import * as React from 'react';
import './multiLevelDropdownMenu.scss';
import { Tabs } from './components';

type Submenu = {
  title: string;
  submenu?: Submenu;
}[];

type Title = {
  title: string;
  // submenu?: {
  //   title: string;
  // }[];
  submenu?: Submenu;
};
const titles: Title[] = [
  {
    title: 'Home',
  },
  {
    title: 'Services',
    submenu: [
      {
        title: 'web design',
      },
      {
        title: 'web development',
        submenu: [
          {
            title: 'Frontend',
          },
          {
            title: 'Backend',
            submenu: [
              {
                title: 'NodeJS',
              },
              {
                title: 'PHP',
              },
              {
                title: 'web development',
                submenu: [
                  {
                    title: 'Frontend',
                  },
                  {
                    title: 'Backend',
                    submenu: [
                      {
                        title: 'NodeJS',
                      },
                      {
                        title: 'PHP',
                      },
                    ],
                  },
                ],
              },
            ],
          },
        ],
      },
      {
        title: 'SEO',
      },
    ],
  },
  {
    title: 'About',
    submenu: [
      {
        title: 'Who we are',
      },
      {
        title: 'Our values',
      },
    ],
  },
];

const MultiLevelDropdownMenu: React.FC = () => {
  return (
    <ul className={'tabs'}>
      {titles.map((menu, index) => {
        const depthLevel = 0;
        return (
          <Tabs
            depthLevel={depthLevel}
            items={menu}
            key={String(Date.now() + index)}
          />
        );
      })}
    </ul>
  );
};

export { MultiLevelDropdownMenu };
